import { render } from "react-dom";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Todo from "./routes/Todo";

function App() {
	<BrowserRouter>

			<div>
				<Link
					to="/"
					element={<Todo />}
				/>
			</div>

		;
	</BrowserRouter>;

}

export default App;
